import "./SubBlock.scss";
const SubBlock = () => {
  return (
    <div className="subBlock">
      <div className="headerLeft">
        <h3> {"Yenilikçi ve Kaliteli Hizmet"}</h3>
        <h1> {" Minerva Advocaten Dutch Law Firm"}</h1>
        <p>
          {" "}
          {
            " At Netherlands Law Firm Minerva Advocaten Rotterdam, professionalism, creativity and performance go hand in hand. We like what we do. Our clients appreciate our approach. Our motto: 'Your problem, our concern.'At Netherlands Law Firm Minerva Advocaten Rotterdam, professionalism, creativity and performance go hand in hand. We like what we do. Our clients appreciate our approach. Our motto: 'Your problem, our concern.'"
          }{" "}
        </p>
      </div>
    </div>
  );
};
export default SubBlock;
